from typing import List

class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m = len(board)
        n = len(board[0])

        maxValues = [[float('-inf')] * 3 for _ in range(m)]
        colIndices = [[-1] * 3 for _ in range(m)]

        for i in range(m):
            for j in range(n):
                for k in range(3):
                    if board[i][j] > maxValues[i][k]:
                        for l in range(2, k, -1):
                            maxValues[i][l] = maxValues[i][l-1]
                            colIndices[i][l] = colIndices[i][l-1]
                        maxValues[i][k] = board[i][j]
                        colIndices[i][k] = j
                        break

        maxSum = float('-inf')

        for r1 in range(m):
            for r2 in range(r1 + 1, m):
                for r3 in range(r2 + 1, m):
                    for c1 in range(3):
                        for c2 in range(3):
                            if colIndices[r2][c2] == colIndices[r1][c1]:
                                continue
                            for c3 in range(3):
                                if colIndices[r3][c3] == colIndices[r1][c1] or colIndices[r3][c3] == colIndices[r2][c2]:
                                    continue
                                currentSum = maxValues[r1][c1] + maxValues[r2][c2] + maxValues[r3][c3]
                                maxSum = max(maxSum, currentSum)

        return maxSum
